import React from 'react';
import {css, StyleSheet} from 'aphrodite';
import Text from "../../../helpers/Text";

function Service({firstComponent, secondComponent, isButton = false}) {

    // outer: {
    //     borderRadius:"8px",
    //     justifyContent:"space-between",
    //     padding:"1.3rem",
    //     border:"1px solid #EAE9F2",
    //     width: "14rem",
    //     height: "1rem",
    //     marginBottom:"0.8rem",
    // },
    return (
        <div className={"alItCenter row service-box"}>
            {firstComponent}
            {secondComponent}
        </div>
    );
}

export default Service;
